import React, { useState, useEffect } from "react";
import firebase from "firebase/compat/app";
import "firebase/compat/database";

const firebaseConfig = {
  apiKey: "AIzaSyBF8Q3AuT5m-iBayXDt82r8RyADUdnyGsk",
  databaseURL:
    "https://classroom-1a392-default-rtdb.asia-southeast1.firebasedatabase.app",
};
firebase.initializeApp(firebaseConfig);

const database = firebase.database();


const Teacher = () => {
    const [messageSent, setMessageSent] = useState(false);
    const [status, setStatus] = useState("");
    const [mesin, setMesin] = useState("");
    const [line, setLine] = useState("");
    const [nama, setNama] = useState("");
    const [timer, setTimer] = useState("");
  
  
    const [Name1, setName1] = useState("");
    const [Name2, setName2] = useState("");
    const [Name3, setName3] = useState("");
    const [Name4, setName4] = useState("");
    const [Name5, setName5] = useState("");
    const [Name6, setName6] = useState("");
    const [Name7, setName7] = useState("");
    const [Name8, setName8] = useState("");
    const [Name9, setName9] = useState("");
  
    const [Student1, setStudent1] = useState("");
    const [backgroundColorStudent1, setBackgroundColorStudent1] = useState("");
  
  
  
    const [Student2, setStudent2] = useState("");
    const [backgroundColorStudent2, setBackgroundColorStudent2] = useState("");
    const [Student3, setStudent3] = useState("");
    const [backgroundColorStudent3, setBackgroundColorStudent3] = useState("");
    const [Student4, setStudent4] = useState("");
    const [backgroundColorStudent4, setBackgroundColorStudent4] = useState("");
    const [Student5, setStudent5] = useState("");
    const [backgroundColorStudent5, setBackgroundColorStudent5] = useState("");
    const [Student6, setStudent6] = useState("");
    const [backgroundColorStudent6, setBackgroundColorStudent6] = useState("");
    const [Student7, setStudent7] = useState("");
    const [backgroundColorStudent7, setBackgroundColorStudent7] = useState("");
    const [Student8, setStudent8] = useState("");
    const [backgroundColorStudent8, setBackgroundColorStudent8] = useState("");
    const [Student9, setStudent9] = useState("");
    const [backgroundColorStudent9, setBackgroundColorStudent9] = useState("");
    const [selectedItem, setSelectedItem] = useState(null);
    const [data, setData] = useState([]);
  
    const [OpenStudent1, setOpenStudent1] = useState(null);
    const [OpenStudent2, setOpenStudent2] = useState(null);
    const [OpenStudent3, setOpenStudent3] = useState(null);
    const [OpenStudent4, setOpenStudent4] = useState(null);
    const [OpenStudent5, setOpenStudent5] = useState(null);
    const [OpenStudent6, setOpenStudent6] = useState(null);
    const [OpenStudent7, setOpenStudent7] = useState(null);
    const [OpenStudent8, setOpenStudent8] = useState(null);
    const [OpenStudent9, setOpenStudent9] = useState(null);
    // Di luar komponen
  
  
    // Di dalam komponen
  
  
    const [EditProfil, setEditProfil] = useState(false);
  
    // SUBMIT FILE
    const [file, setFile] = useState(null);
  



  

  useEffect(() => {
    fetch("http://localhost:3001/api/get/students")
      .then((response) => response.json())
      .then((data) => {
        setData(data);
        const foundItem = data.find(item => item.No === 1);
        if (foundItem) {
          setName1(foundItem.Name);
          const foundItem2 = data.find(item => item.No === 2);
          if (foundItem2) {
            setName2(foundItem2.Name);
          }
          const foundItem3 = data.find(item => item.No === 3);
          if (foundItem3) {
            setName3(foundItem3.Name);
          }
          const foundItem4 = data.find(item => item.No === 4);
          if (foundItem4) {
            setName4(foundItem4.Name);
          }
          const foundItem5 = data.find(item => item.No === 5);
          if (foundItem5) {
            setName5(foundItem5.Name);
          }
          const foundItem6 = data.find(item => item.No === 6);
          if (foundItem6) {
            setName6(foundItem6.Name);
          }
          const foundItem7 = data.find(item => item.No === 7);
          if (foundItem7) {
            setName7(foundItem7.Name);
          }
          const foundItem8 = data.find(item => item.No === 8);
          if (foundItem8) {
            setName8(foundItem8.Name);
          }
        }
      })
      .catch((error) => {
        // Tangani error jika permintaan gagal
        console.error("Error fetching data:", error);
      });
  }, []);

  return (
    <main>
      <div
        class="w-full  shadow-xl rounded-lg flex overflow-x-auto custom-scrollbar"
        style={{
          height: "200vh",
          background: "#005A5B",
        }}
      >
        <div class="w-64 px-4 ">
          <div class="h-16 flex items-center">
            <a
              href="/"
              class="w-48 mx-auto bg-red-800 hover:bg-red-500 flex items-center justify-center text-gray-100 py-2 rounded space-x-2 transition duration-150"
            >
              <span>Logout</span>
            </a>
          </div>
          <div class="px-2 pt-4 pb-8 h-[600px]  border-r border-gray-300">
            <ul class="space-y-2">
              <li>
                <a class=" bg-opacity-30 text-blue-500 flex items-center justify-between py-1.5 px-4 rounded cursor-pointer">
                  <span class="flex items-center space-x-2">
                    <svg
                      xmlns="http://www.w3.org/2000/svg"
                      class="h-5 w-5"
                      fill="none"
                      viewBox="0 0 24 24"
                      stroke="currentColor"
                    >
                      <path
                        stroke-linecap="round"
                        stroke-linejoin="round"
                        stroke-width="2"
                        d="M20 13V6a2 2 0 00-2-2H6a2 2 0 00-2 2v7m16 0v5a2 2 0 01-2 2H6a2 2 0 01-2-2v-5m16 0h-2.586a1 1 0 00-.707.293l-2.414 2.414a1 1 0 01-.707.293h-3.172a1 1 0 01-.707-.293l-2.414-2.414A1 1 0 006.586 13H4"
                      ></path>
                    </svg>
                    <span>Schedule</span>
                  </span>
                </a>
              </li>
              <li>
                <a href="Information" class="hover: hover:bg-opacity-10 hover:text-blue-500 flex items-center text-white py-1.5 px-4 rounded space-x-2 cursor-pointer">
                  <svg
                    xmlns="http://www.w3.org/2000/svg"
                    class="h-5 w-5"
                    fill="none"
                    viewBox="0 0 24 24"
                    stroke="currentColor"
                  >
                    <path
                      stroke-linecap="round"
                      stroke-linejoin="round"
                      stroke-width="2"
                      d="M5 5a2 2 0 012-2h10a2 2 0 012 2v16l-7-3.5L5 21V5z"
                    ></path>
                  </svg>
                  <span>Information</span>
                </a>
              </li>
              <li>
                <a href="Students" class="hover: hover:bg-opacity-10 hover:text-blue-500 flex items-center text-white py-1.5 px-4 rounded space-x-2 cursor-pointer">
                  <svg
                    xmlns="http://www.w3.org/2000/svg"
                    class="h-5 w-5"
                    fill="none"
                    viewBox="0 0 24 24"
                    stroke="currentColor"
                  >
                    <path
                      stroke-linecap="round"
                      stroke-linejoin="round"
                      stroke-width="2"
                      d="M5 5a2 2 0 012-2h10a2 2 0 012 2v16l-7-3.5L5 21V5z"
                    ></path>
                  </svg>
                  <span>Students</span>
                </a>
              </li>
              <li>
                <a href="Teacher" class="hover: hover:bg-opacity-10 hover:text-blue-500 flex items-center text-white py-1.5 px-4 rounded space-x-2 cursor-pointer">
                  <svg
                    xmlns="http://www.w3.org/2000/svg"
                    class="h-5 w-5"
                    fill="none"
                    viewBox="0 0 24 24"
                    stroke="currentColor"
                  >
                    <path
                      stroke-linecap="round"
                      stroke-linejoin="round"
                      stroke-width="2"
                      d="M5 5a2 2 0 012-2h10a2 2 0 012 2v16l-7-3.5L5 21V5z"
                    ></path>
                  </svg>
                  <span>Teacher</span>
                </a>
              </li>
              {/* <li>
                <a class="hover: hover:bg-opacity-10 hover:text-blue-500 flex items-center text-white py-1.5 px-4 rounded space-x-2 cursor-pointer">
                  <svg
                    xmlns="http://www.w3.org/2000/svg"
                    class="h-5 w-5 rotate-90"
                    fill="none"
                    viewBox="0 0 24 24"
                    stroke="currentColor"
                  >
                    <path
                      stroke-linecap="round"
                      stroke-linejoin="round"
                      stroke-width="2"
                      d="M12 19l9 2-9-18-9 18 9-2zm0 0v-8"
                    ></path>
                  </svg>
                  <span>Sent</span>
                </a>
              </li> */}
            </ul>
          </div>
        </div>

        <div class="flex-1 px-2">
          <div className="mt-12">
            <span className="text-white text-2xl font-semibold">
              Add Schedule
            </span>
